import React from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';

function Header() {
  return (
      <div>
          <header>
              Explore Uttarakhand
          </header>
      </div>

  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Header/>
  </React.StrictMode>
);

